import React from "react";
import ReactDOM from "react-dom";
import Card from './App'
import Array from './Array'
// console.log(Array[0])
ReactDOM.render(
  <>
    <Card img={Array[0].img} title={Array[0].title} span={Array[0].span } ankar={Array[0].ankar}/>
    <Card img={Array[1].img} title={Array[1].title} span={Array[1].span } ankar={Array[1].ankar}/>
    <Card img={Array[2].img} title={Array[2].title} span={Array[2].span } ankar={Array[2].ankar}/>
  </>,
  document.getElementById("root")
);
